    public JavaLexer() { }

    private String trimEnd(String str) {
        int end = str.length() - 1;
        int i = end;
        for (; i >= 0; i--) {
            char c = str.charAt(i);
            if (c != ' ' && c != '\t' && c != '\r' && c != '\n') {
                break;
            }
        }
        if (i != end) {
            return str.substring(0, i + 1);
        }

        return str;
    }

    public String convert(AbstractCCodeHandler h, String code) {
        Reader reader = new StringReader(trimEnd(code));
        String str = convert(h, reader, true);
        try {
            reader.close();
        } catch (IOException e) { }

        return str;
    }

    public String convert(AbstractCCodeHandler h, Reader code, boolean ret) {
        if (code == null) {
            return null;
        } else {
            handler = h;
            whitesOnFirstLine = 0;
            yyreset(code);
            yybegin(CLEANFIRST);
            try {
                yylex();
            } catch (IOException e) {
                return null;
            }
            if (ret) {
                return h.toString();
            }
            return "";
        }
    }


